INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (8, 10030, "ルルィ", "2025/03/15 15:00:00", "2025/06/23 14:59:59", 2, 136902, 1, -470.0, 5.53, 1, "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", 2002, 0.0);
