INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (9, 10036, "ユキノ", "2025/06/16 15:00:00", "2025/09/23 14:59:59", 2, 135802, 5, -470.0, 7.441, 1, "ら、ら、らっしゃっせ…\nなんかほしいもん、ある？\nか、かき氷とか、ど…？", 2002, 0.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (9, 10037, "ユキノ", "2025/06/16 15:00:00", "2025/09/23 14:59:59", 7, 135802, 7, -470.0, 0.0, 2, "そ、そんな見ねぇで…\nあては、売りもんじゃ\nねぇよ…？", 2002, 0.0);
