INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (10, 10040, "ヴォルガーノ", "2025/09/16 15:00:00", "2025/12/22 14:59:59", 2, 137701, 1, -470.0, 5.549, 1, "よぅ！　今日の俺さまは\n門番じゃなく、店番だぜ\nメモピ～スフィア～てな！", 2002, 0.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (10, 10041, "ヴォルガーノ", "2025/09/16 15:00:00", "2025/12/22 14:59:59", 3, 137701, 6, -470.0, 2.64, 2, "…リマさんのブロマイド？\n買い取るに決まってらぁ！\nなんでも持ってけ泥棒っ！", 2002, 0.0);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (11, 10042, "ライラエル", "2025/12/15 15:00:00", "2026/03/23 11:59:59", 7, 132801, 4, -470.0, 7.642, 1, "こ、この格好は…ヴルムが\n集客効果があると言って…\n…本当でしょうか？", 2002, 0.0);
